import React from 'react';
import './Navbar.css';
const Navbar = () => {
  return (
    <div>
      <section>Hello Name</section>
        <div className='Nav-search'>
            <input type='text' placeholder='enter product name'/>
        </div>    
      </div>
  )
}

export default Navbar
